import styled from "styled-components";

export const Container=styled.div`
padding:0px 65px ;
`
export const Content=styled.div`
display: flex;
justify-content: space-between;
flex-direction: column;
`
export const Card=styled.div`
width: 1105px;
height: 60px;
background: #FFFFFF;
box-shadow: 0px 20px 25px rgba(176, 177, 181, 0.432802);
border-radius: 6px;
margin-top: 9px;
display: flex;
flex-direction: row;
align-items: center;
`

export const CardImg=styled.img`
margin: 0px 34px 0px 18px;
`
export const Title=styled.div`
margin-right: 219px;
margin-left: 18px;
font-family: SFProDisplay;
font-size: 13px;
line-height: 15px;
color: #2D3A45;
`
export const Kategoriya=styled.div`
margin-right: 230px;
font-family: SFProDisplay;
font-size: 13px;
line-height: 15px;
color: #2D3A45;
`
export const OtherName=styled.div`
margin-right: 244px;
font-family: SFProDisplay;
font-size: 13px;
line-height: 15px;
color: #2D3A45;
`
export const Deleted=styled.div`
width: 32px;
height: 32px;
background: #FFFFFF;
box-shadow: 0px 2px 2px rgba(174, 176, 181, 0.414986);
border-radius: 16px;
display: flex;
align-items: center;
justify-content: center;
cursor: pointer;
`
export const Edited=styled.div`
width: 32px;
height: 32px;
background: #FFFFFF;
box-shadow: 0px 2px 2px rgba(174, 176, 181, 0.414986);
border-radius: 16px;
display: flex;
align-items: center;
justify-content: center;
margin-right: 28px;
cursor: pointer;
`

export  const EditedImg=styled.img`


`

export  const DeletedImg=styled.img`

`
